SELECT "USCensus_1"."Agep (bin)" AS "Agep (bin)",   CAST("USCensus_1"."REGION" AS BIGINT) AS "REGION",   CAST("USCensus_1"."SCHL" AS TEXT) AS "SCHL",   SUM(CAST("USCensus_1"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok" FROM "USCensus_1" GROUP BY 1,   "USCensus_1"."REGION",   3,   2
SELECT "USCensus_3"."Agep (bin)" AS "Agep (bin)",   CAST("USCensus_3"."REGION" AS BIGINT) AS "REGION",   CAST("USCensus_3"."SCHL" AS TEXT) AS "SCHL",   SUM(CAST("USCensus_3"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok" FROM "USCensus_3" GROUP BY 1,   "USCensus_3"."REGION",   3,   2
SELECT "USCensus_3"."Agep (bin)" AS "Agep (bin)",   CAST("USCensus_3"."SCHL" AS TEXT) AS "SCHL",   CAST("USCensus_3"."SEX" AS BIGINT) AS "SEX",   SUM(CAST("USCensus_3"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok" FROM "USCensus_3" WHERE (("USCensus_3"."Agep (bin)" >= 2) AND ("USCensus_3"."Agep (bin)" <= 9)) GROUP BY 1,   2,   "USCensus_3"."SEX",   3
SELECT CAST("USCensus_2"."REGION" AS BIGINT) AS "REGION",   CAST("USCensus_2"."ST" AS BIGINT) AS "ST (ss13pusa.csv+)",   COUNT(DISTINCT CAST("USCensus_2"."SERIALNO" AS TEXT)) AS "TEMP(Calculation_368169302745513989)(1337797081)(0)",   SUM(CAST("USCensus_2"."Number of Records" AS BIGINT)) AS "TEMP(Calculation_368169302745513989)(3967762572)(0)" FROM "USCensus_2" GROUP BY "USCensus_2"."REGION",   "USCensus_2"."ST",   1,   2
SELECT CAST("USCensus_3"."CIT" AS TEXT) AS "CIT",   CAST("USCensus_3"."REGION" AS BIGINT) AS "REGION",   SUM(CAST("USCensus_3"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok" FROM "USCensus_3" GROUP BY 1,   "USCensus_3"."REGION",   2
SELECT CAST("USCensus_3"."ESR" AS BIGINT) AS "ESR",   CAST("USCensus_3"."SCH" AS TEXT) AS "SCH",   SUM(CAST("USCensus_3"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok" FROM "USCensus_3" WHERE (CAST("USCensus_3"."AGEP" AS BIGINT) > 15) GROUP BY "USCensus_3"."ESR",   2,   1
SELECT CAST("USCensus_3"."REGION" AS BIGINT) AS "REGION",   CAST("USCensus_3"."ST" AS BIGINT) AS "ST (ss13pusa.csv+)",   COUNT(DISTINCT CAST("USCensus_3"."SERIALNO" AS TEXT)) AS "TEMP(Calculation_368169302745513989)(1337797081)(0)",   SUM(CAST("USCensus_3"."Number of Records" AS BIGINT)) AS "TEMP(Calculation_368169302745513989)(3967762572)(0)" FROM "USCensus_3" GROUP BY "USCensus_3"."REGION",   "USCensus_3"."ST",   1,   2
SELECT CAST("USCensus_3"."REGION" AS BIGINT) AS "REGION",   COUNT(DISTINCT "USCensus_3"."SERIALNO1") AS "ctd:SERIALNO:ok",   SUM(CAST("USCensus_3"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok" FROM "USCensus_3" GROUP BY "USCensus_3"."REGION",   1
